import React, { useState } from "react";
import "../App.css";

function Contact() {
  const [name, setName] = useState("");
  const [subject, setSubject] = useState("");
  const [email, setEmail] = useState("");
  const [message, setMessage] = useState("");

  const [error, setError] = useState(false);

  const [done, setDone] = useState(false);

  const handleClick = () => {
    console.log("name", name);
    console.log("subject", subject);
    console.log("email", email);
    console.log("message", message);
  };
  return (
    <div>
      <link
        rel="stylesheet"
        href="https://stackpath.bootstrapcdn.com/bootstrap/4.5.2/css/bootstrap.min.css"
        integrity="sha384-JcKb8q3iqJ61gNV9KGb8thSsNjpSL0n8PARn9HuZOnIxN0hoP+VmmDGMN5t9UJ0Z"
        crossOrigin="anonymous"
      ></link>
      <form>
        <fieldset>
          <div className="row">
            <div className="col contact__col">
              <input
                onChange={(e) => setName(e.target.value)}
                value={name}
                type="text"
                className="form-control"
                placeholder="Name * "
              />
            </div>
          </div>
          <div className="row">
            <div className="col contact__col">
              <input
                onChange={(e) => setEmail(e.target.value)}
                value={email}
                type="text"
                className="form-control"
                placeholder="Email * "
              />
            </div>
          </div>
          <div className="row">
            <div className="col contact__col">
              <input
                onChange={(e) => setSubject(e.target.value)}
                value={subject}
                type="text"
                className="form-control"
                placeholder="Subject * "
              />
            </div>
          </div>
          <div>
            <textarea
              className="Message"
              value={message}
              onChange={(e) => setMessage(e.target.value)}
              cols="50"
              rows="15"
              placeholder="Message * "
            ></textarea>
          </div>

          <div onClick={handleClick} className="light center">
            <div className="waves-effect waves-light btn-large">
              <i className="material-icons center">send</i>
            </div>
          </div>
          <div className="alert alert-danger center" role="alert">
            A simple danger alertâ€”check it out!
          </div>
        </fieldset>
      </form>
    </div>
  );
}

export default Contact;
